import React, { useState } from 'react';
import { useDispatch } from 'react-redux';
import { login } from '../redux/slices/authSlice';
import { useNavigate } from 'react-router-dom';
export default function Login(){
  const [form,setForm] = useState({ email:'', password:''});
  const dispatch = useDispatch(); const navigate = useNavigate();
  const submit = async (e)=>{ e.preventDefault(); const res = await dispatch(login(form)); navigate('/dashboard'); };
  return (
    <div style={{display:'flex',alignItems:'center',justifyContent:'center',height:'80vh'}}>
      <div style={{width:420, padding:30, background:'#fff', borderRadius:8}}>
        <h2>Welcome Back</h2>
        <form onSubmit={submit}>
          <input className="input" name="email" placeholder="Email" value={form.email} onChange={e=>setForm({...form,email:e.target.value})} />
          <input className="input" type="password" name="password" placeholder="Password" value={form.password} onChange={e=>setForm({...form,password:e.target.value})} />
          <button className="btn" style={{width:'100%'}}>Sign In</button>
        </form>
      </div>
    </div>
  );
}
